    def addOperators(self, num, target):
        """
        :type num: str
        :type target: int
        :rtype: List[str]
        """

        def backtrack(i, curr, prev, res, op):
            if i == len(num):
                if curr == target:
                    res.append(op)
                return
            for j in range(i, len(num)):
                if j > i and num[i] == '0':
                    break
                curr_num = int(num[i:j+1])
                if op:
                    backtrack(j+1, curr + curr_num, curr_num, res, op + '+' + str(curr_num))
                    backtrack(j+1, curr - curr_num, -curr_num, res, op + '-' + str(curr_num))
                else:
                    backtrack(j+1, curr_num, curr_num, res, str(curr_num))

        res = []
        backtrack(0, 0, 0, res, '')
        return res

