class Solution(object):
    def canCompleteCircuit(self, gas, cost):
        """
        :type gas: List[int]
        :type cost: List[int]
        :rtype: int
        """

        ## 1. find the sum of gas and cost
        ## 2. if the sum of gas is less than the sum of cost, return -1
        ## 3. if the sum of gas is greater than the sum of cost, return 0
        ## 4. if the sum of gas is greater than the sum of cost, return the index of the first station

